import (
	context "context"
	fern "github.com/literal/fern"
	fernclient "github.com/literal/fern/client"
)

client := fernclient.NewClient()
response, err := client.Headers.Send(
	context.TODO(),
	&fern.SendLiteralsInHeadersRequest{
		Query: "What is the weather today",
	},
)

import (
	context "context"
	fern "github.com/literal/fern"
	fernclient "github.com/literal/fern/client"
)

client := fernclient.NewClient()
response, err := client.Inlined.Send(
	context.TODO(),
	&fern.SendLiteralsInlinedRequest{
		Temperature: fern.Float64(
			10.1,
		),
	},
)

import (
	context "context"
	fern "github.com/literal/fern"
	fernclient "github.com/literal/fern/client"
)

client := fernclient.NewClient()
response, err := client.Reference.Send(
	context.TODO(),
	&fern.SendRequest{
		Query: "What is the weather today",
		ContainerObject: &fern.ContainerObject{
			NestedObjects: []*fern.NestedObjectWithLiterals{
				&fern.NestedObjectWithLiterals{
					StrProp: "strProp",
				},
			},
		},
	},
)
